import unittest
from edu.fitchburgstate.taylor.arabic.base.feature import readFeatureTag
from edu.fitchburgstate.taylor.arabic.base.bigram import readBigram
from edu.fitchburgstate.taylor.arabic.base.lattice import Lattice

class latticeTest(unittest.TestCase):

    def setUp(self):
        pass


    def tearDown(self):
        pass

    def testPopulateBigram(self):
        lat = Lattice()
        lat.addItem(readBigram(latticeTestData.b1text))
        #print(lat)
        self.assertEqual(81, len(lat.nodes), "Wrong number of nodes")
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.b1nodes, "Missing node")

        lat.addItem(readBigram(latticeTestData.b2text))
        #print(lat)
        self.assertEqual(146, len(lat.nodes), "Wrong number of nodes")
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.b2nodes, "Missing node")

        lat.addItem(readBigram(latticeTestData.b3text))
        self.assertEqual(163, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b4text))
        self.assertEqual(180, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b5text))
        self.assertEqual(225, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b6text))
        self.assertEqual(262, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b7text))
        self.assertEqual(343, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b8text))
        self.assertEqual(408, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.b9text))
        self.assertEqual(437, len(lat.nodes), "Wrong number of nodes")
        lat.addItem(readBigram(latticeTestData.batext))
        self.assertEqual(447, len(lat.nodes), "Wrong number of nodes")
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.banodes, "Missing node")
        lat.addItem(readBigram(latticeTestData.batext))
        self.assertEqual(447, len(lat.nodes), "Wrong number of nodes")
        self.assertEqual(11, lat.itemcount)

    def testPopulateFeature(self):
        lat = Lattice()
        lat.addItem(readFeatureTag(latticeTestData.f1text))
        self.assertEqual(9, len(lat.nodes), "Wrong number of nodes")
        #print(lat)
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.f1nodes, "Missing node")

        lat.addItem(readFeatureTag(latticeTestData.f2text))
        self.assertEqual(18, len(lat.nodes), "Wrong number of nodes")
        #print(lat)
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.f2nodes, "Missing node")

        lat.addItem(readFeatureTag(latticeTestData.f3text))
        self.assertEqual(19, len(lat.nodes), "Wrong number of nodes")
        #print(lat)
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.f3nodes, "Missing node")

        lat.addItem(readFeatureTag(latticeTestData.f4text))
        self.assertEqual(24, len(lat.nodes), "Wrong number of nodes")
        #print(lat)
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.f4nodes, "Missing node")

        lat.addItem(readFeatureTag(latticeTestData.f5text))
        self.assertEqual(29, len(lat.nodes), "Wrong number of nodes")
        #print(lat)
        for node in lat.nodes.values():
            self.assertIn(str(node), latticeTestData.f5nodes, "Missing node")

    def testGetLeastFeature(self):
        lat = Lattice()
        lat.addItem(readFeatureTag(latticeTestData.f1text))
        lat.addItem(readFeatureTag(latticeTestData.f2text))
        lat.addItem(readFeatureTag(latticeTestData.f3text))
        lat.addItem(readFeatureTag(latticeTestData.f4text))
        lat.addItem(readFeatureTag(latticeTestData.f5text))

        for pair in latticeTestData.featureGetLeast:
            self.checkFeatureFindLeast(lat, pair[0], pair[1])

    def testGetLeastBigram(self):
        lat = Lattice()
        lat.addItem(readBigram(latticeTestData.b1text))
        lat.addItem(readBigram(latticeTestData.b2text))
        lat.addItem(readBigram(latticeTestData.b3text))
        lat.addItem(readBigram(latticeTestData.b4text))
        lat.addItem(readBigram(latticeTestData.b5text))
        lat.addItem(readBigram(latticeTestData.b6text))
        lat.addItem(readBigram(latticeTestData.b7text))
        lat.addItem(readBigram(latticeTestData.b8text))
        lat.addItem(readBigram(latticeTestData.b9text))
        lat.addItem(readBigram(latticeTestData.batext))

        for pair in latticeTestData.bigramGetLeast:
            self.checkBigramFindLeast(lat, pair[0], pair[1])


    def checkFeatureFind(self, lat, txt):
        ft = readFeatureTag(txt)
        ftfound = lat.getLeast(ft)
        self.assertFeatureEquality(ft, ftfound)

    def checkFeatureFindLeast(self, lat, ftxt, chktext):
        ft = readFeatureTag(ftxt)
        ftfound = lat.getLeast(ft)
        self.assertFeatureEquality(chktext, ftfound)

    def checkBigramFindLeast(self, lat, ftxt, chktext):
        ft = readBigram(ftxt)
        ftfound = lat.getLeast(ft)
        self.assertBigramEquality(chktext, ftfound)

    def assertFeatureEquality(self, f1, f2):
        self.assertEqual(str(f1), str(f2), 
                    "Feature not found correctly '{0}' != '{1}'".format(str(f2), str(f1)))

    def assertBigramEquality(self, f1, f2):
        self.assertEqual(str(f1), str(f2), 
                    "Bigram not found correctly '{0}' != '{1}'".format(str(f2), str(f1)))

